import { Button } from "react-bootstrap";
import React from "react";

export default function Logout(prop) {
  function handleClear(e) {
    e.preventDefault();
    if (localStorage.removeItem("UserEmail")) {
      prop.history.push("/login");
    }
  }
  return (
    <div>
      <Button variant="primary" type="submit" onClick={handleClear}>
        Log Out
      </Button>
    </div>
  );
}
